addpath('Projekt 1/scripts')
addpath('Projekt 1/functions')
addpath('Projekt 1')

fig_folder = fullfile('wykresy', 'task_1');
if ~exist(fig_folder, 'dir')
    mkdir(fig_folder);
end
%[text] Ładowanie Prametrów
C1 = 0.62;
C2 = 0.71;
alpha1 = 19;
alpha2 = 37;

F1pp = 240;
Fdpp = 140;
tau = 175;

F1max = 300;
F1min = 40;

h1pp = 1/alpha1^2*(F1pp+Fdpp)^2 %[output:8e79ba4e]
h2pp = alpha1^2/alpha2^2*h1pp %[output:54073731]

h1max = 1/alpha1^2*(F1max+Fdpp)^2 %[output:1339dafd]
h2max = alpha1^2/alpha2^2*h1max %[output:9cd6d30a]
h1min = 1/alpha1^2*(F1min+Fdpp)^2 %[output:716a0a58]
h2min = alpha1^2/alpha2^2*h1min %[output:11a2af5a]

Ts = 35; % Must be a divisor of tau

test_feedforward = false;
use_feedforward = false;
%[text] Symulacja modelu ciągłęgo nieliniowego
n = 50;

F1s = genF1trajectory(40, F1max, F1pp, n);
dtStep = 100000;
dtStep = floor(dtStep/Ts)*Ts;

Tsim = n*dtStep;

t_steps = (1:n)*dtStep;   % [t0, t0+dt, t0+2dt, ...]

Fin_fun = @(t) F1s( max( 1, sum(t(:) >= t_steps) ) );
Fd_fun = @(t) Fdpp;

x0 = [h1pp; h2pp];

[t,x] = ode45(@(t,x) f_nonlinear(t,x,Fin_fun,Fd_fun,tau,C1,C2,alpha1,alpha2), [0 Tsim], x0);

h1 = x(:,1);
h2 = x(:,2);

figure(11); %[output:4217f59e]
plot(t, h1, 'DisplayName','h_1(t) - ciągłe'); hold on; %[output:4217f59e]
figure(22); %[output:30afd564]
plot(t, h2, 'DisplayName','h_2(t) - ciągłe'); hold on; %[output:30afd564]
%[text] Symulacja modelu dyskretnego nieliniowego
kk = floor(Tsim/Ts);

k_tau = tau / Ts;

h1 = ones(1, kk)*h1pp;
h2 = ones(1, kk)*h2pp;
Fd = ones(1, kk)*Fdpp;
F1 = ones(1, kk)*F1pp;

k_jump = floor(kk/n);
for i = 1:n-1
    for k = i*k_jump+1:(i+1)*k_jump
        F1(k) = F1s(i);
    end
end


for k = k_tau+2:kk
    h1(k) = h1(k-1) + Ts * (1/(2*C1*h1(k-1))) * ...
        (F1(k-1-k_tau) + Fd(k-1) - alpha1*sqrt(h1(k-1)));
    
    h2(k) = h2(k-1) + Ts * (1/(3*C2*(h2(k-1))^2)) * ...
        (alpha1*sqrt(h1(k-1)) - alpha2*sqrt(h2(k-1)));

    h1(k) = max(h1(k), 0);
    h2(k) = max(h2(k), 0);
end

t = (0:kk-1) * Ts;
figure(11);
stairs(t, h1, '--', 'DisplayName','h_1 - dyskr.'); %[output:4217f59e]
grid on; xlabel('t [s]'); ylabel('h1'); legend('Location','best'); %[output:4217f59e]
title('Symulacja modeli: ciągłego i dyskretnego nieliniowego'); %[output:4217f59e]
exportgraphics(gcf, fullfile(fig_folder, 'task_1_h1_cont_disc.pdf'), 'ContentType', 'vector'); %[output:4217f59e]

figure(22);
stairs(t, h2, '--', 'DisplayName','h_2 - dyskr.'); %[output:30afd564]
grid on; xlabel('t [s]'); ylabel('h2'); legend('Location','best'); %[output:30afd564]
title('Symulacja modeli: ciągłego i dyskretnego nieliniowego'); %[output:30afd564]
exportgraphics(gcf, fullfile(fig_folder, 'task_1_h2_cont_disc.pdf'), 'ContentType', 'vector'); %[output:30afd564]
%[text] Symulacja modelu dyskretnego zlinearyzowanego
h1bar = h1pp;
h2bar = h2pp;
F1bar = F1pp;
Fdbar = Fdpp;

calc_h = true;

[Ad, Bd, Ed, h1bar, h2bar, F1bar, Fdbar] = f_disc_lin(C1, C2, alpha1, alpha2, F1bar, Fdbar, Ts, calc_h);

h1_lin = zeros(1,kk);
h2_lin = zeros(1,kk);

h1_lin(1:k_tau+1) = h1pp;
h2_lin(1:k_tau+1) = h2pp;

for k = k_tau+2:kk
    xtilde = [h1_lin(k-1)-h1bar; h2_lin(k-1)-h2bar];
    utilde =  F1(k-1-k_tau) - F1bar;
    dtilde =  Fd(k-1)       - Fdbar;

    xtilde_next = Ad*xtilde + Bd*utilde + Ed*dtilde;
    x_next = [h1bar; h2bar] + xtilde_next;

    % opcjonalnie: zachowanie dodatniości
    h1_lin(k) = max(x_next(1), 0);
    h2_lin(k) = max(x_next(2), 0);
end

% compute RMSE between discrete NL and linearized h2
n_common = min(length(h2), length(h2_lin));
err = h2(1:n_common) - h2_lin(1:n_common);
rmse_h2 = sqrt(mean(err.^2));
disp(['RMSE h_2: ', num2str(rmse_h2)]); %[output:3220e187]

% --- Porównawczy wykres z modelem NL (dyskretnym) ---
figure; %[output:34ee6186]
stairs(t, h1, 'DisplayName','h_1 NL'); hold on; %[output:34ee6186]
stairs(t, h1_lin, '--', 'DisplayName','h_1 LIN'); %[output:34ee6186]
grid on; xlabel('t [s]'); ylabel('h [cm]'); %[output:34ee6186]
legend('Location','best'); title('NL vs. LIN (model dyskretny)'); %[output:34ee6186]
exportgraphics(gcf, fullfile(fig_folder, 'task_1_h1_lin_nonlin.pdf'), 'ContentType', 'vector'); %[output:34ee6186]

figure; %[output:62070f84]
stairs(t, h2, 'DisplayName','h_2 NL'); hold on; %[output:62070f84]
stairs(t, h2_lin, '--', 'DisplayName','h_2 LIN'); %[output:62070f84]
grid on; xlabel('t [s]'); ylabel('h [cm]'); %[output:62070f84]
legend('Location','best'); title('NL vs. LIN (model dyskretny)'); %[output:62070f84]
exportgraphics(gcf, fullfile(fig_folder, 'task_1_h2_lin_nonlin.pdf'), 'ContentType', 'vector'); %[output:62070f84]

%[text] Odpowiedź skokowa w torze zakłócenia oraz w torze sterowania w punkcje linearyzacji
[S, Sz] = step_resp(h1bar, h2bar, F1bar, Fdbar, Ts, k_tau, C1, C2, alpha1, alpha2);
figure; %[output:6c7d94ca]
stairs(S) %[output:6c7d94ca]
hold on; %[output:6c7d94ca]
stairs(Sz, '--') %[output:6c7d94ca]
xlabel('k'); ylabel('s(k)') %[output:6c7d94ca]
legend('S', 'Sz', 'Location', 'Best'); %[output:6c7d94ca]

disp(['Size of S: ', num2str(size(S))]); %[output:8f8b1bbc]
disp(['Size of Sz: ', num2str(size(Sz))]); %[output:60a37b32]
%[text] Macierze M, Mp, Mpz i K
D = size(S, 2) %[output:9d6b4352]
Dz = size(Sz, 2);
N = 130;
Nu = 30;
lambda = 10;
u_max = F1max;

M = zeros(N, Nu);
for i = 1:N
    for j = 1:Nu
        if i >= j
            M(i, j) = S(i-j+1);
        end
    end
end

Mp = zeros(N, D-1);
for i = 1:N
    for j = 1:D-1
        if i+j <= D
            Mp(i, j) = S(i+j) - S(j);
        else
            Mp(i, j) = S(D) - S(j);
        end
    end
end

Mz_p = zeros(N, Dz);
for i = 1:N
    for j = 1:Dz
        if i+j <= Dz
            Mz_p(i, j) = Sz(i+j) - Sz(j);
        else
            Mz_p(i, j) = Sz(Dz) - Sz(j);
        end
    end
end

K = inv(M'*M + lambda*eye(Nu))* M';
K1 = K(1, :);
%[text] Pętla Regulacji DMC

Tsim = 400000;
kk_dmc = floor(Tsim/Ts) %[output:33a1c5d9]

u_dmc = ones(1,kk_dmc)*F1pp;
y_dmc = ones(1, kk_dmc)*h2pp;
h1_dmc = ones(1, kk_dmc)*h1pp;
z_dmc = ones(1, kk_dmc)*Fdpp;

dUp = zeros(D-1, 1);
dZp = zeros(Dz, 1);
yzad = ones(1, kk_dmc)*h2pp;

if ~test_feedforward
    yzad(k_tau+2:kk_dmc) = h2max;
    yzad(floor(kk_dmc/3):kk_dmc) = h2min*2;
    yzad(floor(kk_dmc/2):kk_dmc) = h2max/1.5;
    yzad(floor(3*kk_dmc/4):kk_dmc) = h2pp;
else
    fig_folder = fullfile('wykresy', 'task_4');
    if ~exist(fig_folder, 'dir')
        mkdir(fig_folder);
    end
    yzad(floor(kk_dmc/3):kk_dmc) = h2pp/1.1;
    z_dmc(floor(kk_dmc/2):kk_dmc) = Fdpp/2;
end

% Główna pętla obliczeniowa DMC
eps = 0.001;
for k = k_tau+2:kk_dmc

    h1_dmc(k-1) = max(h1_dmc(k-1), eps);
    h1_dmc(k) = h1_dmc(k-1) + Ts * (1/(2*C1*h1_dmc(k-1))) * ...
            (u_dmc(k-1-k_tau) + z_dmc(k-1) - alpha1*sqrt(h1_dmc(k-1)));
    h1_dmc(k) = max(h1_dmc(k), 0);
    y_dmc(k) = y_dmc(k-1) + Ts * (1/(3*C2*(y_dmc(k-1))^2)) * ...
            (alpha1*sqrt(h1_dmc(k-1)) - alpha2*sqrt(y_dmc(k-1)));

    y_dmc(k) = max(y_dmc(k), 0);
    if use_feedforward
        y0 = y_dmc(k) + Mp * dUp + Mz_p * dZp;
    else
        y0 = y_dmc(k) + Mp * dUp;
    end

    du = K1 * (yzad(k)*ones(N,1) - y0);
    if u_dmc(k-1)+du < 0
        du = -u_dmc(k-1);
    end
    if u_dmc(k-1)+du > u_max
        du = u_max - u_dmc(k-1);
    end
    dz = z_dmc(k) - z_dmc(k-1);
    u_dmc(k) = u_dmc(k-1) + du;
    dUp = [du; dUp(1:end-1)];
    dZp = [dz; dZp(1:end-1)];
    
end
err = y_dmc-yzad;
% Calculate and display the RMSE for the DMC output
rmse_dmc = sqrt(mean(err.^2));
disp(['RMSE DMC: ', num2str(rmse_dmc)]); %[output:175b7893]



% Plot the results
figure; %[output:5098310c]
stairs(1:kk_dmc, yzad, '--', 'LineWidth', 1.5); hold on; %[output:5098310c]
stairs(1:kk_dmc, y_dmc', 'LineWidth', 1.5); hold off; %[output:5098310c]
grid on; %[output:5098310c]
legend('Wartość zadana', 'Wyjście układu', 'Location', 'best'); %[output:5098310c]
title(['DMC Wyjście układu (N=', num2str(N), ', Nu=', num2str(Nu), ', \lambda =', num2str(lambda), ')']); %[output:5098310c]
xlabel('k'); %[output:5098310c]
ylabel('y(k)'); %[output:5098310c]

exportgraphics(gcf, fullfile(fig_folder, ['dmc_y_N', num2str(N), '_Nu', num2str(Nu), '_lambda', num2str(lambda), '_feedforward.pdf']), 'ContentType', 'vector'); %[output:5098310c]

figure; %[output:387e4510]
stairs(1:kk_dmc, u_dmc, 'LineWidth', 1.5); %[output:387e4510]
grid on; %[output:387e4510]
title(['DMC - Sygnał sterujący (N=', num2str(N), ', Nu=', num2str(Nu), ', \lambda=', num2str(lambda), ')']); %[output:387e4510]
xlabel('k'); %[output:387e4510]
ylabel('u(k)'); %[output:387e4510]


exportgraphics(gcf, fullfile(fig_folder, ['dmc_u_N', num2str(N), '_Nu', num2str(Nu), '_lambda', num2str(lambda), '_feedforward.pdf']), 'ContentType', 'vector'); %[output:387e4510]

figure; %[output:618334b6]
stairs(z_dmc, 'LineWidth', 1.5); %[output:618334b6]
grid on; %[output:618334b6]
title('Zakłócenie - DMC'); %[output:618334b6]
xlabel('k'); %[output:618334b6]
ylabel('z(k)'); %[output:618334b6]
if test_feedforward
    exportgraphics(gcf, fullfile(fig_folder, 'dmc_z.pdf'), 'ContentType', 'vector');
end


